                IBufferOptions.State state,
                uint256 strike,
                uint256 amount,
                uint256 lockedAmount,
                uint256 premium,
                uint256 expiration,
                IBufferOptions.OptionType optionType
            ) = binaryOptionsContract.options(options[i].optionId);
